import React from 'react'
import UsersList from '../components/UsersList'

const Users = () => {
  const USERS = [
    {
      id: 1,
      name: "Max Schwarz",
      image: "https://images.unsplash.com/photo-1517436073-3b1b1b7f8d9c?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=500&q=60",
    }
  ]
  return (
    <UsersList items={USERS} />
  )
}

export default Users
